import React from "react";
import Searchbar from "./components/Searchbar";
import Filterbar from "./components/Filterbar";
import Country from "../components/Country";

const Home = () => {
  return (
    <div>
      <Searchbar />
      <Filterbar />
      <Country />
    </div>
  );
};

export default Home;
